                ofd.InitialDirectory = "C:\\";
                ofd.RestoreDirectory = true;
                ofd.Filter = "Html Files (*.html)|*.html|All Files (*.*)|*.*";
                ofd.FilterIndex = 0;
                if (ofd.ShowDialog() == DialogResult.OK)
                {
                    try
                    {
                        fileName = ofd.FileName;
                        txtBox_reportPath.Text = fileName;
                    }
                    catch (Exception ex)
                    {
                        MessageBox.Show(ex.Message);
                    }
                }
            }
            #endregion

            #region AppScan 보고서 내용 파싱
            string htmlSource = File.ReadAllText(fileName);
            WebBrowser webControl = new WebBrowser();
            webControl.DocumentText = htmlSource;

            HtmlDocument doc = webControl.Document;
            doc.Write(htmlSource); // read to AppScan report 

            foreach (HtmlElement divElement in doc.GetElementsByTagName("div"))
            {
                // 취약점 명
                if (divElement.GetAttribute("classname") == "headerIssueType")
                {
                    string vulnerabilityName = System.Text.RegularExpressions.Regex.Replace(divElement.InnerHtml, "<[^>]*>", string.Empty);
                    vulnerabilityNameList.Add(vulnerabilityName.Replace("\n", "").Replace("\r", ""));
                }
                // 취약점 정보
                if (divElement.GetAttribute("classname") == "row")
                {
                    string vulnerabilityinformation = System.Text.RegularExpressions.Regex.Replace(divElement.InnerHtml, "<[^>]*>", string.Empty);
                    vulnerabilityinformation = System.Text.RegularExpressions.Regex.Replace(vulnerabilityinformation, "[\\w*|\\s*]*:\\s|호스트", string.Empty);
                    vulnerabilityInformationList.Add(vulnerabilityinformation.Replace("\n", "").Replace("\r", ""));
                }
                // 취약점 Payload
                if (divElement.GetAttribute("classname") == "code test")
                {
                    vulnerabilityPayloadList.Add(divElement.InnerText);
                }
            }
            #endregion

            #region 취약점 중복 값 제거
            foreach (string data in vulnerabilityNameList)
            {
                if (!reportingvulnerabilityNameList.Contains(data))
                {
                    reportingvulnerabilityNameList.Add(data);
                }
            }
            #endregion

            #region 체크박스리스트에 리포팅할 취약점 목록 업데이트
            foreach (string vulner in reportingvulnerabilityNameList)
            {
                if (vulner != null)
                {
                    chkListBox_Vulnerlist.Items.Add(vulner);
                }
            }
            #endregion
        }

