                return;
            }
            #endregion

            #region 변수 생성
            int reportingVulnerabilityIndex = 1;
            int reportingVulnerabilityInformationIndex = 1;
            int reportingDetailSheetCount = 0;

            bool reportingVulnerabilityInformationBool = false;
            string reportingSummary = "";

            System.Collections.IEnumerator impactVunerability;
            impactVunerability = chkListBox_Vulnerlist.CheckedIndices.GetEnumerator();

            Excel.Application resultReport = new Excel.Application();    //Excel application create
            resultReport.Visible = true;    //true 설정하면 엑셀이 작업되는 내용이 보인다.
            resultReport.Interactive = false;    //false로 설정하면 유저의 조작에 방해받지 않는다.
            #endregion

            #region 보고서 정보 Dictionary에 삽입
            reportElement.Add("reportName", txtBox_reportName.Text); // 보안검수명
            reportElement.Add("domainCategory", cbb_domainCategory.SelectedItem.ToString()); //사이트
            reportElement.Add("time", System.DateTime.Now.ToString("yyyy/MM/dd")); //검수 시작일, 종료일
