            #region 보고서 생성 및 열기
            string reportTemplate = Application.StartupPath + "\\template\\template.xlsx";
            string reportPath = Application.StartupPath + "\\" + reportElement["reportName"] + ".xlsx";
            System.IO.FileInfo reportExists = new System.IO.FileInfo(reportPath);

            if (reportExists.Exists)
            {
                while (true)
                {
