                                try
                                {
                                    vulnerabilitySheet.Cells[vulnerabilityNameLocation1[0], vulnerabilityNameLocation1[1]] = matchingVulnerabilityName[vulnerabilityName];
                                }
                                catch
                                {
                                    vulnerabilitySheet.Cells[vulnerabilityNameLocation1[0], vulnerabilityNameLocation1[1]] = vulnerabilityName;
                                }
                                // 취약점 명2
                                vulnerabilitySheet.Cells[vulnerabilityNameLocation2[0], vulnerabilityNameLocation2[1]] = vulnerabilityInformationList.ElementAt(reportingCauseIndex + ((reportingVulnerabilityInformationIndex - 1) * 9));
                                // Solution
                                vulnerabilitySheet.Cells[solutionLocation[0], solutionLocation[1]] = vulnerabilityInformationList.ElementAt(reportingSolutionIndex + ((reportingVulnerabilityInformationIndex - 1) * 9));
                                // Payload
                                vulnerabilitySheet.Cells[payloadLocation[0], payloadLocation[1]] = vulnerabilityPayloadList.ElementAt((reportingVulnerabilityInformationIndex - 1));
                                // Summary
                                reportingSummary = vulnerabilityInformationList.ElementAt(reportingSummaryIndex + ((reportingVulnerabilityInformationIndex - 1) * 9));
                            }

                            reportingVulnerabilityInformationBool = true;
                        }
                        reportingSummary = reportingSummary + "\n□ 취약점 URL : " + vulnerabilityInformationList.ElementAt(reportingVulnerabilityUrlIndex + ((reportingVulnerabilityInformationIndex - 1) * 9));
                        reportingVulnerabilityInformationIndex++;
                    }
                }
                reportingVulnerabilityInformationBool = false;
                vulnerabilitySheet.Cells[summaryLocation[0], summaryLocation[1]] = reportingSummary;
                reportingVulnerabilityIndex++;
                #endregion
            }
            #region 2.결과 및 개선현황 시트에서 잔여 행 삭제
            statusSheet.Rows[statusReportLocation[0] + reportingVulnerabilityIndex].Delete();
            #endregion
            #endregion

            #region 보고서 종료
            resultReport.Interactive = true; //이제 유저가 조작할수 있어야 하니까.

            resultReport.Workbooks.Close(); //보고서 닫기

            #endregion

            #region 오브젝트 정리
            //오브젝트 해제 하기
            Marshal.ReleaseComObject(resultReport);
            Marshal.ReleaseComObject(summarySheet);
            Marshal.ReleaseComObject(statusSheet);
            Marshal.ReleaseComObject(vulnerabilitySheet);

            //가비지 컬렉터
            GC.Collect();
            #endregion
        }

